import React from "react";
import styled from "styled-components";
import TodoTitle from "./components/TodoTitle";
import TodoInput from "./components/todoInput";

const App = () => {
  return (
    <Body>
      <TodoTitle />
      <TodoInput />
    </Body>
  );
};

const Body = styled.div`
  background-color: powderblue;
  height: 100vh;
`;
export default App;
